import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { FaRocket, FaLightbulb, FaCode, FaChartLine, FaChevronDown, FaCog, FaBook, FaHeadset } from 'react-icons/fa';

function DropdownMenu({ title, items }) {
  const [isOpen, setIsOpen] = useState(false);

  const getIcon = (iconName) => {
    switch (iconName) {
      case 'FaCog': return <FaCog />;
      case 'FaBook': return <FaBook />;
      case 'FaHeadset': return <FaHeadset />;
      default: return <FaCog />;
    }
  };

  return (
    <div className="relative" onMouseEnter={() => setIsOpen(true)} onMouseLeave={() => setIsOpen(false)}>
      <button className="flex items-center hover:text-indigo-400 transition-colors">
        {title}
        <FaChevronDown className="ml-1 h-3 w-3" />
      </button>
      <AnimatePresence>
        {isOpen && (
          <motion.div
            initial={{ opacity: 0, y: -10 }}
            animate={{ opacity: 1, y: 0 }}
            exit={{ opacity: 0, y: -10 }}
            transition={{ duration: 0.2 }}
            className="absolute right-0 mt-2 w-80 rounded-md shadow-lg bg-gray-800 ring-1 ring-black ring-opacity-5 p-4"
          >
            <div className="grid grid-cols-2 gap-4" role="menu" aria-orientation="vertical" aria-labelledby="options-menu">
              {items.map((item, index) => (
                <a
                  key={index}
                  href="#"
                  className="flex flex-col items-center p-3 rounded-md hover:bg-gray-700 transition-colors"
                  role="menuitem"
                >
                  <div className="text-indigo-400 mb-2">
                    {getIcon(item.icon)}
                  </div>
                  <div className="text-sm font-medium text-white">{item.title}</div>
                  <div className="text-xs text-gray-400 mt-1 text-center">{item.description}</div>
                </a>
              ))}
            </div>
          </motion.div>
        )}
      </AnimatePresence>
    </div>
  );
}

function Index() {
  const productItems = [
    { icon: 'FaCog', title: 'Product A', description: 'Innovative solution for your needs' },
    { icon: 'FaBook', title: 'Product B', description: 'Streamline your workflow' },
    { icon: 'FaHeadset', title: 'Product C', description: 'Enhance your productivity' },
    { icon: 'FaCog', title: 'Product D', description: 'Next-gen technology integration' },
  ];

  const serviceItems = [
    { icon: 'FaCog', title: 'Service X', description: 'Customized solutions for your business' },
    { icon: 'FaBook', title: 'Service Y', description: 'Expert consulting and support' },
    { icon: 'FaHeadset', title: 'Service Z', description: '24/7 customer assistance' },
    { icon: 'FaCog', title: 'Service W', description: 'Tailored implementation strategies' },
  ];

  const resourceItems = [
    { icon: 'FaBook', title: 'Blog', description: 'Latest insights and trends' },
    { icon: 'FaCog', title: 'Docs', description: 'Comprehensive guides and tutorials' },
    { icon: 'FaHeadset', title: 'Support', description: 'Get help from our experts' },
    { icon: 'FaBook', title: 'Webinars', description: 'Learn from industry leaders' },
  ];

  return (
    <div className="h-screen bg-gradient-to-br from-gray-900 to-gray-800 text-white overflow-hidden flex flex-col justify-between py-8">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 w-full flex flex-col h-full justify-between">
        {/* Top section with logo, navbar, and icons */}
        <motion.div 
          initial={{ opacity: 0, y: -20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          className="flex justify-between items-center relative"
        >
          <div className="text-2xl font-bold">TokTok</div>

          {/* Centered floating navbar */}
          <nav className="absolute left-1/2 transform -translate-x-1/2">
            <ul className="flex items-center space-x-6 bg-gray-800 bg-opacity-50 backdrop-filter backdrop-blur-lg rounded-full px-6 py-2">
              <li><a href="#" className="hover:text-indigo-400 transition-colors">Home</a></li>
              <li><a href="#" className="hover:text-indigo-400 transition-colors">Pricing</a></li>
              <li><a href="#" className="hover:text-indigo-400 transition-colors">Contact</a></li>
              <li><a href="#" className="hover:text-indigo-400 transition-colors">About</a></li>
              <li className="flex space-x-4">
                <DropdownMenu title="Products" items={productItems} />
                <DropdownMenu title="Services" items={serviceItems} />
                <DropdownMenu title="Resources" items={resourceItems} />
              </li>
            </ul>
          </nav>

          <div className="flex space-x-6">
            <FaRocket className="h-6 w-6 text-indigo-400" />
            <FaLightbulb className="h-6 w-6 text-indigo-400" />
            <FaCode className="h-6 w-6 text-indigo-400" />
            <FaChartLine className="h-6 w-6 text-indigo-400" />
          </div>
        </motion.div>

        {/* Main hero content */}
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.2 }}
          className="text-center my-auto"
        >
          <h1 className="text-4xl tracking-tight font-extrabold sm:text-5xl md:text-6xl">
            <span className="block">Revolutionize Your</span>
            <span className="block text-indigo-400">Software Development</span>
          </h1>
          <p className="mt-3 max-w-md mx-auto text-base text-gray-300 sm:text-lg md:mt-5 md:text-xl md:max-w-3xl">
            TokTok delivers cutting-edge solutions for visionaries. 
            Join our exclusive platform and push the boundaries of what's possible.
          </p>
          <div className="mt-10 flex justify-center">
            <motion.div
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              className="rounded-md shadow"
            >
              <a href="#" className="w-full flex items-center justify-center px-8 py-3 border border-transparent text-base font-medium rounded-md text-white bg-indigo-600 hover:bg-indigo-700 md:py-4 md:text-lg md:px-10">
                Get Started
              </a>
            </motion.div>
            <motion.div
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              className="ml-3 rounded-md shadow"
            >
              <a href="#" className="w-full flex items-center justify-center px-8 py-3 border border-transparent text-base font-medium rounded-md text-indigo-600 bg-white hover:bg-gray-50 md:py-4 md:text-lg md:px-10">
                Learn More
              </a>
            </motion.div>
          </div>
        </motion.div>

        {/* Bottom section with "Trusted by" */}
        <motion.div
